import React from "react";

// material ui
import Typography from "@material-ui/core/Typography";

const title = ({ title }) => {
  return (
    <div>
      <Typography gutterBottom variant="h2" component="h3">
        {title}
      </Typography>
    </div>
  );
};

export default title;
